*{
	margin:0;
	padding: 0;
}
.container{
	background-image: linear-gradient(#000066, black);
	height: 100vh;
	display: flex;
	align-items: center;
	justify-content: center;
}

.clock{
	height: 300px;
	width: 300px;
	border-radius: 50%;
	border:10px solid white;
	position: relative;
}

.hand{
	height: 5px;
	width: 45%;
	background-color: #aabbcc;
	position: absolute;
	top: 50%;
	left: 15px;
	transform-origin: 100%;
	transform: rotate(90deg);
	transition: 0.3s all;
	transition-timing-function: cubic-bezier(.03,1.25,.03,1.27);
}
